import { authActions } from '../../../../redux/store/Auth'

const Dashboard = () => {
    const isLogedIn = useSelector((state: any) => state.auth.isLogedIn)

    axios({
      method: 'get',
      url: 'auth/admin/dashboard',
    }).then(res => {
      console.log(res)
    })

    return (
    <div>
        <h1>Welcom admin</h1>
        <button>Logout</button>
    </div>
  )
}

export default Dashboard
